import React, {Component} from 'react'
import logoimg from '../img/logo.svg'
import 'bootstrap/dist/css/bootstrap.min.css'

class Logo extends Component {
    render() {
        return (
            <div className="row" style={logoContainer}>
                <div className="col-xl-6">
                    <a href="#" style={logoStyle}>Powered by: <img src={logoimg} style={logoimgStyle} alt='Visit Creator`s site' /></a>
                </div>
            </div>
        )
    }
}
const logoContainer = {
    position: 'fixed', 
    bottom: '7px',
    right: '7px',
}
const logoStyle = {
    textDecoration: 'none',
    fontSize: '1.05em',
    color: 'white',
    backgroundColor: 'rgba(51, 51, 51, 0.9)',
    padding: '4px',
    borderRadius: '20px',
}
const logoimgStyle = {
    width: '40%',
    opacity: '1'
}
export default Logo
